import React, { Component } from 'react'
import Layout from '../components/layout'
import AllStaffComponent from '../components/ContainerComponents/allStaff'


export class staff extends Component {
    render() {
        return (
            <div>
               <Layout>
                   <AllStaffComponent />
               </Layout>
            </div>
        )
    }
}

export default staff
